import React from "react";
import VerticalGridList from "../../components/verticalGridList/VerticalGridList";
import HorizontalGridList from "../../components/HorizontalGridList/HorizontalGridList";
// import DropDown from "components/DropDown/DropDown";
import Container from "@material-ui/core/Container";
import MyAutoComplete from "../../components/autoComplete/AutoComplete";

import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {
    marginTop: theme.spacing(4),
  },
}));

const optionList = [
  { title: "Cancer" },
  { title: "Sugar" },
  { title: "Blood Pressure" },
  { title: "Covid-19" },
  { title: "ENT" },
];

const Articles = () => {
  const classes = useStyles();
  return (
    <Container className={classes.root}>
      <h3>Recently added articles</h3>
      <HorizontalGridList />
      <MyAutoComplete list={optionList} />
      <h2>Health Articles</h2>
      <VerticalGridList />
    </Container>
  );
};

export default Articles;
